('node', 'page', 0, 58, 58, 'und', 0, '<p><b><a href="http://drupal.org/project/superfish/">Superfish</a></b> is a Drupal third-party module, integrates jQuery Superfish plugin with your Drupal menus. This popular menu module is developed by <a href="http://drupal.org/user/619294">Mehrpadin</a> and is widely used by Drupal lovers (see the updated statistic number <a href="http://drupal.org/project/usage/superfish">here</a>).</p>\r\n\r\n<p>In overview, Superfish module allows users to add styles to Drupal menus with little CSS effort. This module supports dropdown and navbar menu, RTL language, multi-column sub menus, touchscreen compatible and a lot more features. </p>\r\n\r\n<p>On our both premium and free themes, we support Superfish module. Besides keeping all the settings, styles and features of the module, we create a style for it to fit with each theme style. With extra effort on premium themes, we have responsive Superfish menu which can work on any tablet and mobile device.</p>', '', 'full_html'),
