(4, 'node', ' invitation to present at the ct film of course we have the most comprehensive film tax credit in the nation films commercials new media video games and our education director is the head of the statefunded film industry training program the focus for new media programs this year is free software web new media animation music and advocacy we are further sharing 13 of our curriculum with film and education please email and or call me if you are interested in helping us the festival is may 49 and ours is may 69 i will know more at our next meeting about exact scheduling we aren t a rich festival therefore we cannot pay anyone but we are only 65 miles from nyc on metro north and we can cover your hotel room as long as you wish to stay as well as give you an all access pass for the week looking forward to chatting dave bonan director of new media programming ct film festival wwwctfilmfestcom 2037708304  ', 0),
(5, 'node', ' updated netbeans plugins support for drupal hello drupalers netbeans 65 release candidate is out with right php editing features  http wwwnetbeansorg kb trails phphtml  and along with that i have released an update to the existing drupal support in netbeans please feel free to try out the enhanced wizard for assisting drupal module development the modifications in the plugin are generates the new module in appropriate location sticking to drupal coding standards generates template code for some of the common hooks hookblock and hookhelp in the module file sticking to drupal coding standards generates the install file which when not required can be removed some template code for some common hooks hookinstall and hookuninstall are provided you can download the plugin from netbeans plugin portal  http pluginsnetbeansorg pluginportal faces plugindetailpagejsp plug  or from project page  https nbdrupalsupportdevjavanet servlets projectdocumentlist folder  the source and documentation concerning usage of the plugin is hosted at the latter site comments welcome regards sujit nair demo articles ', 0),
(6, 'node', ' editing documentation embedded into drupal besides the handbook on drupalorg there is also some drupal documentation that is embedded in the drupal source code and visible from the administration pages of a drupal site this includes help pages for modules help text displayed at the top of administration pages and descriptive text within administration pages eg help text for a setting field because embedded documentation is part of the drupal source code the process for helping out with writing and editing this embedded documentation is slightly more complex than for editing pages on drupalorg here are some ways to help out test drupal for text issues during the development of a new drupal version download the new version from http drupalorg project drupal  install it and look over the help screens and user interface text if you find something that should be fixed in a help screen or other embedded help text file an issue even if you do not know how to create a patch you can still give before after text suggestions and someone else can create the patch to file an issue log in to drupalorg create an issue via the create content link  http drupalorg node add projectissue  choose drupal as the project choose the drupal version note that it s really only possible to change user interface text help text and other explanations in the version of drupal that is under development stable releases have been translated into other languages so their user interface text is almost never changed choose component documentation if the issue is in a help screen or user interface text if it is user interface text or choose the module that the issue pertains to as the component tag the issue with uitext or help text as appropriate choose category bug report text being wrong missing or unclear is a bug not a feature request or task make up a clear title and description and submit your issue help with existing issues use the advanced search for issues in the drupal project  http drupalorg project issues search drupal  and look for component documentation or user interface text or search for tags help text or uitext be aware that most of the issues filed under component documentation are issues with the inline programmer api documentation of functions in the source code displayed on apidrupalorg so if you are not a programmer these will not be things you will probably want to work on even if you cannot write patches you can still review patches and make suggestions on how to improve text by commenting on issues some tips on using the issue queue look for issues whose status is active or needs work if you want to write some documentation or code look for needs review issues if you want to review what others have done an excellent place to start if you are new to drupal issues and a vitally important part of the process even if you are not a programmer you can still review patches find an issue that has status needs review scroll down to the bottom of the issue s comments and find the latest patch attachment click on the attachment to see it the lines with are being added lines with are being removed some patches will also have a screen shot making reviewing even easier if you think a patch is good add a comment saying what part you reviewed and that you thought it was good if you think your review was comprehensive or if several people have commented that it s a good patch and you think the coverage overall is comprehensive enough change the issue s status to reviewed and tested by the community also known as rtbc if you think a patch needs some work change the status of the issue to needs work and add a specific comment about what you think should be changed if possible with a suggestion of what to change it to please try to be constructive if the issue you are looking at doesn t yet have a patch you can either make one or add suggestions as to what the text should say someone else can read your suggestions and make a patch if you attach a patch file be sure to change the status of the issue to needs review so others can test and review your patch and above all don t take anything in the issue queue personally the intent of the issue queue is to provide a forum for discussion on how to make drupal better so try to take any comments on your patches as constructive comments and thoughtful discussion even if not everyone writes their comments in this way  demo articles ', 0),
(7, 'node', ' newspaper modules opensourced by studio multimedia france 24 rfi hello two months ago a case study about the migration of france 24 from drupal 5 to drupal 6 was posted on drupalorg frontpage and it was announced some really interesting modules were going to be open sourced i m happy to say it is almost finished and here is the list of modules  multimedia element  it allows you to create blocks not drupal blocks containing stories inserted manually automatically semiautomatically with easy view carousels of stories text photos diaporamas including lightbox diapos video twitter table and you can embed these blocks directly into your story with a nifty fckeditor plugin here is a nice example of story with a carousel a diaporama and a video multimedia element  easy view  easy view is a very easy and powerful interface framework to views in a cck field it also include easy view taxonomy the easy view implementation of the taxonomy view it basically allows a simple user to configure a view per node without using the complex view ui uberimage  uberimage is an advanced image cck field with direct upload nodereference support result imagecache presets rescaling and cropping useful on websites with multiple different image ratio 169 43 165  formatter selector  ever wanted to let the user choose the theme of a node in a nodereference directly on the node edit page this module allows you to do that external sources   externodes  basically this module allows you to map the nid and fid address space to another drupal instance a simple example given you have two drupals if you type in your browser frontdrupalcom node 1000000001 it will in fact display the node 1 of backdrupalcom using frontdrupalcom theme backdrupalcom is nowhere visible to the end user basic example of use a big image collection you want to share between drupals nodeselect  nodeselect allows editors to search for content in a simple exposed view integrated with embedded edit and results can be drag and dropped into nodereferences embedded edit  embedded edit allows you to create view edit a node in a kind of lightbox within a node edit page when creating a node a nodereference will get filled with this node views cck formatter  views cck formatter allows you to choose a node cck formatter as a row style in your view this is extremely useful when you want to reuse a node theme in different parts of your website csv table  csv table is a very simple table module that allows you to upload a csv file in this cck field and display a table this module will probably evolve a lot in the future jcarousel for views  jcarousel for views is a simple module for using jcarousel in views jcarouself formatter framework  jcarousel formatter framework contains the jcarousel plugin plus a node cck formatter jcarousel theme relationships framework utilities  an utilities modules used by all the above modules sorry no pictures you can find them here or directly on the module project page concerning theming the france24 and rfi websites are heavily based on the standard cck nodereference formatters that s why almost all these modules are using it i ll probably make some doc on how to combine all these modules later cheers nicolas demo articles ', 0),
