(17, 'node', ' modules failed to update upgrading drupal i m having a problem updating several modules in drupal 6 i put the site off line and then uploaded the latest modules via ftp as is my usual practice i rename the directory of the module to be updated to modulejan2012 and put the new module folder in its place i then ran updatephp and when i check the modules are still showing as outofdate the problem modules are google analytics wysiwyg imce and webform webform validator and root candy theme updated okay i ve since uploaded the module again to see if this helps but it didn t on the server it s showing that the files were updated many thanks in advance for any suggestions  ', 0),
(18, 'node', ' simplest way to launch drupal on aws installing drupal what would be a best way to launch a simple drupal web site on aws i ve just started learning aws so far from what i have learned i can go either of the following ways 1 create an ec2 instance install xampp and drupal and keep developing web pages and web apps in ec2 i ve done this but i have not figured out how to make the web site accessible do i need to setup elastic ip 2 install drupal on a local machine and develop all web pages and apps locally and then upload all local files to s3 then is s3 enough to host a web site ec2 instance is not needed also who would i manage the upload for constant updates on drupal modules and drupal db well i need to dig more into ec2 and s3 but your input would be highly appreciated  ', 0),
