(21, 'node', ' html and css techniques theme development for all the effort you put into building your site the most important thing to your users is how your site looks managing the inconsistencies in your theme for each browser for each module and for user selectable themes can be very challenging first you should familiarize yourself with basic cascading style sheets css concepts review css discuss or html dog for css resources a good overview of the power of css can be seen at the css zen garden validate always validate xhtml 10 strict permalink submitted by admin on tue 1172012 916 and really a validating clean layout will work 90 of the time it will have easy fixes 9 of the time and will require hard measures only 1 of the time really  log in or register to post comments please ensure that you ve permalink submitted by admin on tue 1172012 917 please ensure that you ve validated both the css and html for your website using w3c tools it would be great to review your theme with both the wave and fae accessibility evaluators too there are also some other good validation tools log in or register to post comments  ', 0),
